import Header from "./Header";
import Section from "./Section";

function App() {
  return (
    <div>
      <Header />
      <main>
        <Section id="sobre" title="Sobre">
          <p>
            Olá! Eu sou um desenvolvedor apaixonado por tecnologia e este é o meu
            portfólio criado em React.
          </p>
        </Section>
      </main>
    </div>
  );
}

export default App;
